import React from "react";
// import Link from "next/link";
// import PropTypes from "prop-types";
import { withTranslation, Link } from "i18n";

const Header = ({ t }) => {
	return (
		<>
			<div>Header created. {t("init")}</div>
			<Link href="/">
				<a>Home</a>
			</Link>
			&nbsp; | &nbsp;
			<Link href="/about">
				<a>About</a>
			</Link>
		</>
	);
};

// Header.propTypes = {
// };

export default withTranslation("header")(Header);
